connect system/oracle
drop user univ cascade;
create user univ identified by univ
default tablespace users
temporary tablespace temp
/

grant connect,resource to univ;
connect univ/univ

create table t_pref(
  pref_cd               varchar2(2) not null,
  pref_name             varchar2(10) not null,
  constraint t_pref_pk primary key(pref_cd)
)
/

create table t_univ(
  univ_cd               varchar2(5) not null,
  pref_cd               varchar2(2) not null,
  url                   varchar2(100),
  univ_name             varchar2(80) not null,
  univ_kana             varchar2(80) not null,
  constraint t_univ_pk primary key(univ_cd)
)
/


commit;


commit;

exit;
